// components/Header.js
import React from 'react';
import { Navbar, Nav, NavDropdown, Container, Row, Col } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';

const Header = () => {
    const navigate = useNavigate();

    const handleLogout = () => {
        // Perform logout logic
        navigate('/login');
    };

    return (
        <Row>
            <Col md={2}>
                <Navbar bg="light" expand="lg" className="flex-column">
                    <Navbar.Brand onClick={() => navigate('/')}>Nutritracker</Navbar.Brand>
                    <Nav className="flex-column">
                        <Nav.Link onClick={() => navigate('/')}>Home</Nav.Link>
                        <Nav.Link onClick={() => navigate('/search')}>Add Food</Nav.Link>
                        <Nav.Link onClick={() => navigate('/custom-foods')}>Custom Foods</Nav.Link>
                        <Nav.Link onClick={() => navigate('/custom-recipes')}>Custom Recipes</Nav.Link>
                    </Nav>
                </Navbar>
            </Col>
            <Col md={10}>
                <Navbar bg="light">
                    <Container>
                        <Nav className="ms-auto">
                            <NavDropdown title="Profile" id="basic-nav-dropdown">
                                <NavDropdown.Item onClick={() => navigate('/profile')}>Profile</NavDropdown.Item>
                                <NavDropdown.Item onClick={handleLogout}>Logout</NavDropdown.Item>
                            </NavDropdown>
                        </Nav>
                    </Container>
                </Navbar>
            </Col>
        </Row>
    );
};

export default Header;
